boolean Event_choice_template::ischosen(Event_choice::union_selection_type checked_selection) const
{
if (checked_selection == Event_choice::UNBOUND_VALUE) TTCN_error("Internal error: Performing ischosen() operation on an invalid field of union type @http_jabber_org_protocol_pubsub_event.Event.choice.");
switch (template_selection) {
case SPECIFIC_VALUE:
if (single_value.union_selection == Event_choice::UNBOUND_VALUE) TTCN_error("Internal error: Invalid selector in a specific value when performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Event.choice.");
return single_value.union_selection == checked_selection;
case VALUE_LIST:
{
if (value_list.n_values < 1)
TTCN_error("Internal error: Performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Event.choice containing an empty list.");
boolean ret_val = value_list.list_value[0].ischosen(checked_selection);
boolean all_same = TRUE;
for (unsigned int list_count = 1; list_count < value_list.n_values; list_count++) {
if (value_list.list_value[list_count].ischosen(checked_selection) != ret_val) {
all_same = FALSE;
break;
}
}
if (all_same) return ret_val;
}
case ANY_VALUE:
case ANY_OR_OMIT:
case OMIT_VALUE:
case COMPLEMENTED_LIST:
TTCN_error("Performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Event.choice, which does not determine unambiguously the chosen field of the matching values.");
default:
TTCN_error("Performing ischosen() operation on an uninitialized template of union type @http_jabber_org_protocol_pubsub_event.Event.choice");
}
return FALSE;
}

void Event_choice_template::log() const
{
switch (template_selection) {
case SPECIFIC_VALUE:
switch (single_value.union_selection) {
case Event_choice::ALT_collection:
TTCN_Logger::log_event_str("{ collection := ");
single_value.field_collection->log();
TTCN_Logger::log_event_str(" }");
break;
case Event_choice::ALT_configuration:
TTCN_Logger::log_event_str("{ configuration := ");
single_value.field_configuration->log();
TTCN_Logger::log_event_str(" }");
break;
case Event_choice::ALT_delete_:
TTCN_Logger::log_event_str("{ delete := ");
single_value.field_delete_->log();
TTCN_Logger::log_event_str(" }");
break;
case Event_choice::ALT_items:
TTCN_Logger::log_event_str("{ items := ");
single_value.field_items->log();
TTCN_Logger::log_event_str(" }");
break;
case Event_choice::ALT_purge:
TTCN_Logger::log_event_str("{ purge := ");
single_value.field_purge->log();
TTCN_Logger::log_event_str(" }");
break;
case Event_choice::ALT_subscription:
TTCN_Logger::log_event_str("{ subscription := ");
single_value.field_subscription->log();
TTCN_Logger::log_event_str(" }");
break;
default:
TTCN_Logger::log_event_str("<invalid selector>");
}
break;
case COMPLEMENTED_LIST:
TTCN_Logger::log_event_str("complement ");
case VALUE_LIST:
TTCN_Logger::log_char('(');
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++) {
if (list_count > 0) TTCN_Logger::log_event_str(", ");
value_list.list_value[list_count].log();
}
TTCN_Logger::log_char(')');
break;
default:
log_generic();
}
log_ifpresent();
}

void Event_choice_template::log_match(const Event_choice& match_value) const
{
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity() && match(match_value)){
TTCN_Logger::print_logmatch_buffer();
TTCN_Logger::log_event_str(" matched");
return;
}
if (template_selection == SPECIFIC_VALUE && single_value.union_selection == match_value.get_selection()) {
switch (single_value.union_selection) {
case Event_choice::ALT_collection:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".collection");
single_value.field_collection->log_match(match_value.collection());
} else {
TTCN_Logger::log_event_str("{ collection := ");
single_value.field_collection->log_match(match_value.collection());
TTCN_Logger::log_event_str(" }");
}
break;
case Event_choice::ALT_configuration:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".configuration");
single_value.field_configuration->log_match(match_value.configuration());
} else {
TTCN_Logger::log_event_str("{ configuration := ");
single_value.field_configuration->log_match(match_value.configuration());
TTCN_Logger::log_event_str(" }");
}
break;
case Event_choice::ALT_delete_:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".delete");
single_value.field_delete_->log_match(match_value.delete_());
} else {
TTCN_Logger::log_event_str("{ delete := ");
single_value.field_delete_->log_match(match_value.delete_());
TTCN_Logger::log_event_str(" }");
}
break;
case Event_choice::ALT_items:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".items");
single_value.field_items->log_match(match_value.items());
} else {
TTCN_Logger::log_event_str("{ items := ");
single_value.field_items->log_match(match_value.items());
TTCN_Logger::log_event_str(" }");
}
break;
case Event_choice::ALT_purge:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".purge");
single_value.field_purge->log_match(match_value.purge());
} else {
TTCN_Logger::log_event_str("{ purge := ");
single_value.field_purge->log_match(match_value.purge());
TTCN_Logger::log_event_str(" }");
}
break;
case Event_choice::ALT_subscription:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".subscription");
single_value.field_subscription->log_match(match_value.subscription());
} else {
TTCN_Logger::log_event_str("{ subscription := ");
single_value.field_subscription->log_match(match_value.subscription());
TTCN_Logger::log_event_str(" }");
}
break;
default:
TTCN_Logger::print_logmatch_buffer();
TTCN_Logger::log_event_str("<invalid selector>");
}
} else {
TTCN_Logger::print_logmatch_buffer();
match_value.log();
TTCN_Logger::log_event_str(" with ");
log();
if (match(match_value)) TTCN_Logger::log_event_str(" matched");
else TTCN_Logger::log_event_str(" unmatched");
}
}

void Event_choice_template::encode_text(Text_Buf& text_buf) const
{
encode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
text_buf.push_int(single_value.union_selection);
switch (single_value.union_selection) {
case Event_choice::ALT_collection:
single_value.field_collection->encode_text(text_buf);
break;
case Event_choice::ALT_configuration:
single_value.field_configuration->encode_text(text_buf);
break;
case Event_choice::ALT_delete_:
single_value.field_delete_->encode_text(text_buf);
break;
case Event_choice::ALT_items:
single_value.field_items->encode_text(text_buf);
break;
case Event_choice::ALT_purge:
single_value.field_purge->encode_text(text_buf);
break;
case Event_choice::ALT_subscription:
single_value.field_subscription->encode_text(text_buf);
break;
default:
TTCN_error("Internal error: Invalid selector in a specific value when encoding a template of union type @http_jabber_org_protocol_pubsub_event.Event.choice.");
}
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
text_buf.push_int(value_list.n_values);
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].encode_text(text_buf);
break;
default:
TTCN_error("Text encoder: Encoding an uninitialized template of type @http_jabber_org_protocol_pubsub_event.Event.choice.");
}
}

void Event_choice_template::decode_text(Text_Buf& text_buf)
{
clean_up();
decode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
{
single_value.union_selection = Event_choice::UNBOUND_VALUE;
Event_choice::union_selection_type new_selection = (Event_choice::union_selection_type)text_buf.pull_int().get_val();
switch (new_selection) {
case Event_choice::ALT_collection:
single_value.field_collection = new Collection_template;
single_value.field_collection->decode_text(text_buf);
break;
case Event_choice::ALT_configuration:
single_value.field_configuration = new Configuration_template;
single_value.field_configuration->decode_text(text_buf);
break;
case Event_choice::ALT_delete_:
single_value.field_delete_ = new Delete_template;
single_value.field_delete_->decode_text(text_buf);
break;
case Event_choice::ALT_items:
single_value.field_items = new Items_template;
single_value.field_items->decode_text(text_buf);
break;
case Event_choice::ALT_purge:
single_value.field_purge = new Purge_template;
single_value.field_purge->decode_text(text_buf);
break;
case Event_choice::ALT_subscription:
single_value.field_subscription = new Subscription_template;
single_value.field_subscription->decode_text(text_buf);
break;
default:
TTCN_error("Text decoder: Unrecognized union selector was received for a template of type @http_jabber_org_protocol_pubsub_event.Event.choice.");
}
single_value.union_selection = new_selection;
}
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
value_list.n_values = text_buf.pull_int().get_val();
value_list.list_value = new Event_choice_template[value_list.n_values];
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].decode_text(text_buf);
break;
default:
TTCN_error("Text decoder: Unrecognized selector was received in a template of type @http_jabber_org_protocol_pubsub_event.Event.choice.");
}
}

boolean Event_choice_template::is_present() const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return FALSE;
return !match_omit();
}

boolean Event_choice_template::match_omit() const
{
if (is_ifpresent) return TRUE;
switch (template_selection) {
case OMIT_VALUE:
case ANY_OR_OMIT:
return TRUE;
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int v_idx=0; v_idx<value_list.n_values; v_idx++)
if (value_list.list_value[v_idx].match_omit())
return template_selection==VALUE_LIST;
return template_selection==COMPLEMENTED_LIST;
default:
return FALSE;
}
return FALSE;
}

void Event_choice_template::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union template type `@http_jabber_org_protocol_pubsub_event.Event.choice'");
    }
    if (strcmp("collection", param_field) == 0) {
      collection().set_param(param);
      return;
    } else if (strcmp("configuration", param_field) == 0) {
      configuration().set_param(param);
      return;
    } else if (strcmp("delete", param_field) == 0) {
      delete_().set_param(param);
      return;
    } else if (strcmp("items", param_field) == 0) {
      items().set_param(param);
      return;
    } else if (strcmp("purge", param_field) == 0) {
      purge().set_param(param);
      return;
    } else if (strcmp("subscription", param_field) == 0) {
      subscription().set_param(param);
      return;
    } else param.error("Field `%s' not found in union template type `@http_jabber_org_protocol_pubsub_event.Event.choice'", param_field);
  }
  param.basic_check(Module_Param::BC_TEMPLATE, "union template");
  switch (param.get_type()) {
  case Module_Param::MP_Omit:
    *this = OMIT_VALUE;
    break;
  case Module_Param::MP_Any:
    *this = ANY_VALUE;
    break;
  case Module_Param::MP_AnyOrNone:
    *this = ANY_OR_OMIT;
    break;
  case Module_Param::MP_List_Template:
  case Module_Param::MP_ComplementList_Template:
    set_type(param.get_type()==Module_Param::MP_List_Template ? VALUE_LIST : COMPLEMENTED_LIST, param.get_size());
    for (size_t p_i=0; p_i<param.get_size(); p_i++) {
      list_item(p_i).set_param(*param.get_elem(p_i));
    }
    break;
  case Module_Param::MP_Value_List:
    if (param.get_size()==0) break;
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_event.Event.choice");
    break;
  case Module_Param::MP_Assignment_List: {
    Module_Param* mp_last = param.get_elem(param.get_size()-1);
    if (!strcmp(mp_last->get_id()->get_name(), "collection")) {
      collection().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "configuration")) {
      configuration().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "delete")) {
      delete_().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "items")) {
      items().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "purge")) {
      purge().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "subscription")) {
      subscription().set_param(*mp_last);
      break;
    }
    mp_last->error("Field %s does not exist in type @http_jabber_org_protocol_pubsub_event.Event.choice.", mp_last->get_id()->get_name());
  } break;
  default:
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_event.Event.choice");
  }
  is_ifpresent = param.get_ifpresent();
}

void Event_choice_template::check_restriction(template_res t_res, const char* t_name) const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return;
switch ((t_name&&(t_res==TR_VALUE))?TR_OMIT:t_res) {
case TR_OMIT:
if (template_selection==OMIT_VALUE) return;
case TR_VALUE:
if (template_selection!=SPECIFIC_VALUE || is_ifpresent) break;
switch (single_value.union_selection) {
case Event_choice::ALT_collection:
single_value.field_collection->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
case Event_choice::ALT_configuration:
single_value.field_configuration->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
case Event_choice::ALT_delete_:
single_value.field_delete_->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
case Event_choice::ALT_items:
single_value.field_items->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
case Event_choice::ALT_purge:
single_value.field_purge->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
case Event_choice::ALT_subscription:
single_value.field_subscription->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
return;
default:
TTCN_error("Internal error: Invalid selector in a specific value when performing check_restriction operation on a template of union type @http_jabber_org_protocol_pubsub_event.Event.choice.");
}
case TR_PRESENT:
if (!match_omit()) return;
break;
default:
return;
}
TTCN_error("Restriction `%s' on template of type %s violated.", get_res_name(t_res), t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Event.choice");
}

void Collection_choice::copy_value(const Collection_choice& other_value)
{
switch (other_value.union_selection) {
case ALT_associate:
field_associate = new Associate(*other_value.field_associate);
break;
case ALT_disassociate:
field_disassociate = new Disassociate(*other_value.field_disassociate);
break;
default:
TTCN_error("Assignment of an unbound union value of type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
}
union_selection = other_value.union_selection;
}

Collection_choice::Collection_choice()
{
union_selection = UNBOUND_VALUE;
}

Collection_choice::Collection_choice(const Collection_choice& other_value)
: Base_Type(){
copy_value(other_value);
}

Collection_choice::~Collection_choice()
{
clean_up();
}

Collection_choice& Collection_choice::operator=(const Collection_choice& other_value)
{
if (this != &other_value) {
clean_up();
copy_value(other_value);
}
return *this;
}

boolean Collection_choice::operator==(const Collection_choice& other_value) const
{
if (union_selection == UNBOUND_VALUE) TTCN_error("The left operand of comparison is an unbound value of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
if (other_value.union_selection == UNBOUND_VALUE) TTCN_error("The right operand of comparison is an unbound value of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
if (union_selection != other_value.union_selection) return FALSE;
switch (union_selection) {
case ALT_associate:
return *field_associate == *other_value.field_associate;
case ALT_disassociate:
return *field_disassociate == *other_value.field_disassociate;
default:
return FALSE;
}
}

Associate& Collection_choice::associate()
{
if (union_selection != ALT_associate) {
clean_up();
field_associate = new Associate;
union_selection = ALT_associate;
}
return *field_associate;
}

const Associate& Collection_choice::associate() const
{
if (union_selection != ALT_associate) TTCN_error("Using non-selected field associate in a value of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
return *field_associate;
}

Disassociate& Collection_choice::disassociate()
{
if (union_selection != ALT_disassociate) {
clean_up();
field_disassociate = new Disassociate;
union_selection = ALT_disassociate;
}
return *field_disassociate;
}

const Disassociate& Collection_choice::disassociate() const
{
if (union_selection != ALT_disassociate) TTCN_error("Using non-selected field disassociate in a value of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
return *field_disassociate;
}

boolean Collection_choice::ischosen(union_selection_type checked_selection) const
{
if (checked_selection == UNBOUND_VALUE) TTCN_error("Internal error: Performing ischosen() operation on an invalid field of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
if (union_selection == UNBOUND_VALUE) TTCN_error("Performing ischosen() operation on an unbound value of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
return union_selection == checked_selection;
}

boolean Collection_choice::is_bound() const
{
  return union_selection != UNBOUND_VALUE;
}

boolean Collection_choice::is_value() const
{
switch (union_selection) {
case UNBOUND_VALUE: return FALSE;
case ALT_associate: return field_associate->is_value();
case ALT_disassociate: return field_disassociate->is_value();
default: TTCN_error("Invalid selection in union is_bound");}
}

void Collection_choice::clean_up()
{
switch (union_selection) {
case ALT_associate:
  delete field_associate;
  break;
case ALT_disassociate:
  delete field_disassociate;
  break;
default:
  break;
}
union_selection = UNBOUND_VALUE;
}

