void Collection_choice::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union type `@http_jabber_org_protocol_pubsub_event.Collection.choice'");
    }
    if (strcmp("associate", param_field) == 0) {
      associate().set_param(param);
      return;
    } else if (strcmp("disassociate", param_field) == 0) {
      disassociate().set_param(param);
      return;
    } else param.error("Field `%s' not found in union type `@http_jabber_org_protocol_pubsub_event.Collection.choice'", param_field);
  }
  param.basic_check(Module_Param::BC_VALUE, "union value");
  if (param.get_type()==Module_Param::MP_Value_List && param.get_size()==0) return;
  if (param.get_type()!=Module_Param::MP_Assignment_List) {
    param.error("union value with field name was expected");
  }
  Module_Param* mp_last = param.get_elem(param.get_size()-1);
  if (!strcmp(mp_last->get_id()->get_name(), "associate")) {
    associate().set_param(*mp_last);
    return;
  }
  if (!strcmp(mp_last->get_id()->get_name(), "disassociate")) {
    disassociate().set_param(*mp_last);
    return;
  }
  mp_last->error("Field %s does not exist in type @http_jabber_org_protocol_pubsub_event.Collection.choice.", mp_last->get_id()->get_name());
}

