boolean Collection_choice_template::match(const Collection_choice& other_value) const
{
if (!other_value.is_bound()) return FALSE;
switch (template_selection) {
case ANY_VALUE:
case ANY_OR_OMIT:
return TRUE;
case OMIT_VALUE:
return FALSE;
case SPECIFIC_VALUE:
{
Collection_choice::union_selection_type value_selection = other_value.get_selection();
if (value_selection == Collection_choice::UNBOUND_VALUE) return FALSE;
if (value_selection != single_value.union_selection) return FALSE;
switch (value_selection) {
case Collection_choice::ALT_associate:
return single_value.field_associate->match(other_value.associate());
case Collection_choice::ALT_disassociate:
return single_value.field_disassociate->match(other_value.disassociate());
default:
TTCN_error("Internal error: Invalid selector in a specific value when matching a template of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
}
}
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
if (value_list.list_value[list_count].match(other_value)) return template_selection == VALUE_LIST;
return template_selection == COMPLEMENTED_LIST;
default:
TTCN_error ("Matching an uninitialized template of union type @http_jabber_org_protocol_pubsub_event.Collection.choice.");
}
return FALSE;
}

