Associate::Associate(const Associate& other_value)
{
if(!other_value.is_bound()) TTCN_error("Copying an unbound value of type @http_jabber_org_protocol_pubsub_event.Associate.");
bound_flag = TRUE;
if (other_value.node().is_bound()) field_node = other_value.node();
else field_node.clean_up();
if (other_value.base().is_bound()) field_base = other_value.base();
else field_base.clean_up();
}

void Associate::clean_up()
{
field_node.clean_up();
field_base.clean_up();
bound_flag = FALSE;
}

Associate& Associate::operator=(const Associate& other_value)
{
if (this != &other_value) {
  if(!other_value.is_bound()) TTCN_error("Assignment of an unbound value of type @http_jabber_org_protocol_pubsub_event.Associate.");
  bound_flag = TRUE;
  if (other_value.node().is_bound()) field_node = other_value.node();
  else field_node.clean_up();
  if (other_value.base().is_bound()) field_base = other_value.base();
  else field_base.clean_up();
}
return *this;
}

boolean Associate::operator==(const Associate& other_value) const
{
if (!is_bound() && !other_value.is_bound()) return TRUE;
return field_node==other_value.field_node
  && field_base==other_value.field_base;
}

