Collection::Collection(const Collection& other_value)
{
if(!other_value.is_bound()) TTCN_error("Copying an unbound value of type @http_jabber_org_protocol_pubsub_event.Collection.");
bound_flag = TRUE;
if (other_value.node().is_bound()) field_node = other_value.node();
else field_node.clean_up();
if (other_value.choice().is_bound()) field_choice = other_value.choice();
else field_choice.clean_up();
}

void Collection::clean_up()
{
field_node.clean_up();
field_choice.clean_up();
bound_flag = FALSE;
}

Collection& Collection::operator=(const Collection& other_value)
{
if (this != &other_value) {
  if(!other_value.is_bound()) TTCN_error("Assignment of an unbound value of type @http_jabber_org_protocol_pubsub_event.Collection.");
  bound_flag = TRUE;
  if (other_value.node().is_bound()) field_node = other_value.node();
  else field_node.clean_up();
  if (other_value.choice().is_bound()) field_choice = other_value.choice();
  else field_choice.clean_up();
}
return *this;
}

boolean Collection::operator==(const Collection& other_value) const
{
if (!is_bound() && !other_value.is_bound()) return TRUE;
return field_node==other_value.field_node
  && field_choice==other_value.field_choice;
}

boolean Collection::is_bound() const
{
if (bound_flag) return TRUE;
if(OPTIONAL_OMIT == field_node.get_selection() || field_node.is_bound()) return TRUE;
if(field_choice.is_bound()) return TRUE;
return FALSE;
}
boolean Collection::is_value() const
{
if (!is_bound()) return FALSE;
if(OPTIONAL_OMIT != field_node.get_selection() && !field_node.is_value()) return FALSE;
if(!field_choice.is_value()) return FALSE;
return TRUE;
}
