boolean Items_choice_template::match(const Items_choice& other_value) const
{
if (!other_value.is_bound()) return FALSE;
switch (template_selection) {
case ANY_VALUE:
case ANY_OR_OMIT:
return TRUE;
case OMIT_VALUE:
return FALSE;
case SPECIFIC_VALUE:
{
Items_choice::union_selection_type value_selection = other_value.get_selection();
if (value_selection == Items_choice::UNBOUND_VALUE) return FALSE;
if (value_selection != single_value.union_selection) return FALSE;
switch (value_selection) {
case Items_choice::ALT_item__list:
return single_value.field_item__list->match(other_value.item__list());
case Items_choice::ALT_retract__list:
return single_value.field_retract__list->match(other_value.retract__list());
default:
TTCN_error("Internal error: Invalid selector in a specific value when matching a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
}
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
if (value_list.list_value[list_count].match(other_value)) return template_selection == VALUE_LIST;
return template_selection == COMPLEMENTED_LIST;
default:
TTCN_error ("Matching an uninitialized template of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
return FALSE;
}

