boolean Items_choice_template::ischosen(Items_choice::union_selection_type checked_selection) const
{
if (checked_selection == Items_choice::UNBOUND_VALUE) TTCN_error("Internal error: Performing ischosen() operation on an invalid field of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
switch (template_selection) {
case SPECIFIC_VALUE:
if (single_value.union_selection == Items_choice::UNBOUND_VALUE) TTCN_error("Internal error: Invalid selector in a specific value when performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
return single_value.union_selection == checked_selection;
case VALUE_LIST:
{
if (value_list.n_values < 1)
TTCN_error("Internal error: Performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice containing an empty list.");
boolean ret_val = value_list.list_value[0].ischosen(checked_selection);
boolean all_same = TRUE;
for (unsigned int list_count = 1; list_count < value_list.n_values; list_count++) {
if (value_list.list_value[list_count].ischosen(checked_selection) != ret_val) {
all_same = FALSE;
break;
}
}
if (all_same) return ret_val;
}
case ANY_VALUE:
case ANY_OR_OMIT:
case OMIT_VALUE:
case COMPLEMENTED_LIST:
TTCN_error("Performing ischosen() operation on a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice, which does not determine unambiguously the chosen field of the matching values.");
default:
TTCN_error("Performing ischosen() operation on an uninitialized template of union type @http_jabber_org_protocol_pubsub_event.Items.choice");
}
return FALSE;
}

void Items_choice_template::log() const
{
switch (template_selection) {
case SPECIFIC_VALUE:
switch (single_value.union_selection) {
case Items_choice::ALT_item__list:
TTCN_Logger::log_event_str("{ item_list := ");
single_value.field_item__list->log();
TTCN_Logger::log_event_str(" }");
break;
case Items_choice::ALT_retract__list:
TTCN_Logger::log_event_str("{ retract_list := ");
single_value.field_retract__list->log();
TTCN_Logger::log_event_str(" }");
break;
default:
TTCN_Logger::log_event_str("<invalid selector>");
}
break;
case COMPLEMENTED_LIST:
TTCN_Logger::log_event_str("complement ");
case VALUE_LIST:
TTCN_Logger::log_char('(');
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++) {
if (list_count > 0) TTCN_Logger::log_event_str(", ");
value_list.list_value[list_count].log();
}
TTCN_Logger::log_char(')');
break;
default:
log_generic();
}
log_ifpresent();
}

void Items_choice_template::log_match(const Items_choice& match_value) const
{
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity() && match(match_value)){
TTCN_Logger::print_logmatch_buffer();
TTCN_Logger::log_event_str(" matched");
return;
}
if (template_selection == SPECIFIC_VALUE && single_value.union_selection == match_value.get_selection()) {
switch (single_value.union_selection) {
case Items_choice::ALT_item__list:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".item_list");
single_value.field_item__list->log_match(match_value.item__list());
} else {
TTCN_Logger::log_event_str("{ item_list := ");
single_value.field_item__list->log_match(match_value.item__list());
TTCN_Logger::log_event_str(" }");
}
break;
case Items_choice::ALT_retract__list:
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
TTCN_Logger::log_logmatch_info(".retract_list");
single_value.field_retract__list->log_match(match_value.retract__list());
} else {
TTCN_Logger::log_event_str("{ retract_list := ");
single_value.field_retract__list->log_match(match_value.retract__list());
TTCN_Logger::log_event_str(" }");
}
break;
default:
TTCN_Logger::print_logmatch_buffer();
TTCN_Logger::log_event_str("<invalid selector>");
}
} else {
TTCN_Logger::print_logmatch_buffer();
match_value.log();
TTCN_Logger::log_event_str(" with ");
log();
if (match(match_value)) TTCN_Logger::log_event_str(" matched");
else TTCN_Logger::log_event_str(" unmatched");
}
}

void Items_choice_template::encode_text(Text_Buf& text_buf) const
{
encode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
text_buf.push_int(single_value.union_selection);
switch (single_value.union_selection) {
case Items_choice::ALT_item__list:
single_value.field_item__list->encode_text(text_buf);
break;
case Items_choice::ALT_retract__list:
single_value.field_retract__list->encode_text(text_buf);
break;
default:
TTCN_error("Internal error: Invalid selector in a specific value when encoding a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
text_buf.push_int(value_list.n_values);
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].encode_text(text_buf);
break;
default:
TTCN_error("Text encoder: Encoding an uninitialized template of type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
}

void Items_choice_template::decode_text(Text_Buf& text_buf)
{
clean_up();
decode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
{
single_value.union_selection = Items_choice::UNBOUND_VALUE;
Items_choice::union_selection_type new_selection = (Items_choice::union_selection_type)text_buf.pull_int().get_val();
switch (new_selection) {
case Items_choice::ALT_item__list:
single_value.field_item__list = new Items_choice_item__list_template;
single_value.field_item__list->decode_text(text_buf);
break;
case Items_choice::ALT_retract__list:
single_value.field_retract__list = new Items_choice_retract__list_template;
single_value.field_retract__list->decode_text(text_buf);
break;
default:
TTCN_error("Text decoder: Unrecognized union selector was received for a template of type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
single_value.union_selection = new_selection;
}
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
value_list.n_values = text_buf.pull_int().get_val();
value_list.list_value = new Items_choice_template[value_list.n_values];
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].decode_text(text_buf);
break;
default:
TTCN_error("Text decoder: Unrecognized selector was received in a template of type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
}

boolean Items_choice_template::is_present() const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return FALSE;
return !match_omit();
}

boolean Items_choice_template::match_omit() const
{
if (is_ifpresent) return TRUE;
switch (template_selection) {
case OMIT_VALUE:
case ANY_OR_OMIT:
return TRUE;
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int v_idx=0; v_idx<value_list.n_values; v_idx++)
if (value_list.list_value[v_idx].match_omit())
return template_selection==VALUE_LIST;
return template_selection==COMPLEMENTED_LIST;
default:
return FALSE;
}
return FALSE;
}

void Items_choice_template::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union template type `@http_jabber_org_protocol_pubsub_event.Items.choice'");
    }
    if (strcmp("item_list", param_field) == 0) {
      item__list().set_param(param);
      return;
    } else if (strcmp("retract_list", param_field) == 0) {
      retract__list().set_param(param);
      return;
    } else param.error("Field `%s' not found in union template type `@http_jabber_org_protocol_pubsub_event.Items.choice'", param_field);
  }
  param.basic_check(Module_Param::BC_TEMPLATE, "union template");
  switch (param.get_type()) {
  case Module_Param::MP_Omit:
    *this = OMIT_VALUE;
    break;
  case Module_Param::MP_Any:
    *this = ANY_VALUE;
    break;
  case Module_Param::MP_AnyOrNone:
    *this = ANY_OR_OMIT;
    break;
  case Module_Param::MP_List_Template:
  case Module_Param::MP_ComplementList_Template:
    set_type(param.get_type()==Module_Param::MP_List_Template ? VALUE_LIST : COMPLEMENTED_LIST, param.get_size());
    for (size_t p_i=0; p_i<param.get_size(); p_i++) {
      list_item(p_i).set_param(*param.get_elem(p_i));
    }
    break;
  case Module_Param::MP_Value_List:
    if (param.get_size()==0) break;
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_event.Items.choice");
    break;
  case Module_Param::MP_Assignment_List: {
    Module_Param* mp_last = param.get_elem(param.get_size()-1);
    if (!strcmp(mp_last->get_id()->get_name(), "item_list")) {
      item__list().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "retract_list")) {
      retract__list().set_param(*mp_last);
      break;
    }
    mp_last->error("Field %s does not exist in type @http_jabber_org_protocol_pubsub_event.Items.choice.", mp_last->get_id()->get_name());
  } break;
  default:
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_event.Items.choice");
  }
  is_ifpresent = param.get_ifpresent();
}

void Items_choice_template::check_restriction(template_res t_res, const char* t_name) const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return;
switch ((t_name&&(t_res==TR_VALUE))?TR_OMIT:t_res) {
case TR_OMIT:
if (template_selection==OMIT_VALUE) return;
case TR_VALUE:
if (template_selection!=SPECIFIC_VALUE || is_ifpresent) break;
switch (single_value.union_selection) {
case Items_choice::ALT_item__list:
single_value.field_item__list->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Items.choice");
return;
case Items_choice::ALT_retract__list:
single_value.field_retract__list->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Items.choice");
return;
default:
TTCN_error("Internal error: Invalid selector in a specific value when performing check_restriction operation on a template of union type @http_jabber_org_protocol_pubsub_event.Items.choice.");
}
case TR_PRESENT:
if (!match_omit()) return;
break;
default:
return;
}
TTCN_error("Restriction `%s' on template of type %s violated.", get_res_name(t_res), t_name ? t_name : "@http_jabber_org_protocol_pubsub_event.Items.choice");
}


