boolean Subscription_subscription_template::match(Subscription_subscription::enum_type other_value) const
{
switch (template_selection) {
case SPECIFIC_VALUE:
return single_value == other_value;
case OMIT_VALUE:
return FALSE;
case ANY_VALUE:
case ANY_OR_OMIT:
return TRUE;
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
if (value_list.list_value[list_count].match(other_value)) return template_selection == VALUE_LIST;
return template_selection == COMPLEMENTED_LIST;
default:
TTCN_error("Matching an uninitialized/unsupported template of enumerated type @http_jabber_org_protocol_pubsub_event.Subscription.subscription.");
}
return FALSE;
}

boolean Subscription_subscription_template::match(const Subscription_subscription& other_value) const
{
if (other_value.enum_value == Subscription_subscription::UNBOUND_VALUE) TTCN_error("Matching a template of enumerated type @http_jabber_org_protocol_pubsub_event.Subscription.subscription with an unbound value.");
return match(other_value.enum_value);
}

