single_value = (Subscription_subscription::enum_type)text_buf.pull_int().get_val();
if (!Subscription_subscription::is_valid_enum(single_value)) TTCN_error("Text decoder: Unknown numeric value %d was received for a template of enumerated type @http_jabber_org_protocol_pubsub_event.Subscription.subscription.", single_value);
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
